textOriginal:
Não é por Bolsonaro.
É contra esse tipo de proposta:





*Proposta do PT*

Pela liberdade sexual e de género; Por sindicatos fortes e atuantes;
Direito a liberdade aborto; * Liberação ordenada das drogas;
Estado livre de movimentos cristãos; *Desarmamento geral da população;
Educação inclusiva LGBTQIA+;
Descriminalização de pequenos delitos 
Regularização 
das mídias e redes sociais; *Para o Brasil voltar a ser feliz!!!

É isto que você quer para sua família?
